import React, { Component } from 'react'
import { connect } from 'react-redux'

class Posts extends Component {
    render() {
        return (
            <div>
                <ol>
                    {this.props.posts.length > 0 &&
                        this.props.posts.map(post => (
                            <li key={post.id}>{post.title}</li>
                        ))
                    }
                </ol>
            </div>
        )
    }
}

export default Posts
